import Layout from '../components/Layout'
import fetch from 'isomorphic-unfetch'
import PowerstatsContainer from '../components/PowerstatsContainer'

//no 501 entry
const Index = (props) => (
  <>
  <Layout>
  hello next
  
  {props.data.name}
  <PowerstatsContainer stats={props.data.powerstats}/>
  <img src={props.data.images.lg} alt=""/>
  </Layout>
  </>
)

Index.getInitialProps = async function() {
  const res = await fetch
  ('https://cdn.rawgit.com/akabab/superhero-api/0.2.0/api/id/502.json')
  const data = await res.json()
  console.log(data)
  return {
    data
  }
}


export default Index;
